description:
First published in University of California Publications 'American Archaeology and Ethnology' in 1907, this book lookes at the myths and legends of the Maidu, Wintun, Yann, Shasta, Miwok, Shoshoni, and other nations.

Kroeber, AL - Indian Myths of South Central California


